function Circuits() {
  this.totalCircuits = function() {
    return 2;
  };

  this.getStart = function(i) {
    // [x, y, z, rot(y)]
    return [
      [-50, 6, 10, 3.0],
      [11, 6, 10, 2.1],
      [11, 6, 10, 2.1]
    ][i];
  };
  
  this.getCircuit = function(i) {
    return [
      "data:image/png;base64,",
      "data:image/png;base64,",
      "data:image/png;base64,"
    ][i];
  };
  
  this.getAudio = function(i) {
    return [
      "data:audio/mp3;base64,",
      null,
      null
    ][i];
  };
}